<!DOCTYPE html>
<html lang="en">
<head>
    <meta name="theme-color" content="#000000"/>
    <title>DogePass</title>
    <style>
        body {
            background-color: #000000;
            max-width: 460px;
        }

        body div {
            /* Flex */
            flex-direction: row;
            /* Alignment */
            align-items: center;
        }

        html {
            /* Overflow */
            overflow-x: hidden;
            /* Flex */
            display: flex;
            flex-direction: column;
            /* Alignment */
            justify-content: center;
            justify-items: center;
            align-content: center;
            align-items: center;
            /* Positioning */
            position: fixed;
            /* Sides */
            top: 0;
            bottom: 0;
            left: 0;
            right: 0;
            /* Sizing */
            height: 100%;
            width: 100%;
        }

        body {
            /* Sizing */
            width: 100%;
            /* Background */
            -webkit-background-size: cover;
            -moz-background-size: cover;
            -o-background-size: cover;
            background-size: cover;
            background-attachment: fixed;
            background-repeat: no-repeat;
        }

        textarea {
            text-align: left !important;
            text-align-last: left !important;
        }

        [text = ""], [text = true], a, p, [input = ""], [input = true], button, input, select, textarea, [row = ""], [row = true], [column = ""], [column = true], div, body {
            /* WebKit */
            -webkit-appearance: none;
            /* Display */
            display: flex;
            flex-direction: column;
            /* Text */
            color: black;
            font-size: large;
            font-family: Arial, ArialHebrew, sans-serif;
            /* Text Alignment */
            text-align: center;
            text-align-last: center;
        }

        [text = ""], [text = true], a, p {
            flex-flow: wrap;
            height: auto;
        }

        [text = ""], [text = true], a, p, [input = ""], [input = true], button, input, select, textarea {
            /* Positioning */
            margin: 1vh;
            padding: 1vh;
            /* Alignment */
            justify-content: center;
            justify-items: center;
            align-content: center;
            align-items: center;
            /* Shaping */
            border-radius: 1vh;
            border-color: transparent;
        }

        [input = ""], [input = true], button, input, select, textarea {
            transition-duration: 0.2s;
            background-color: #ddddee;
        }

        [input = ""]:hover, [input = true]:hover, button:hover, input:hover, select:hover, textarea:hover {
            background-color: #9999aa;
        }

        [row = ""], [row = true], [column = ""], [column = true], div, body {
            /* Alignment */
            justify-content: center;
            align-content: center;
            /* Positioning */
            margin: 0;
            padding: 0;
        }

        [column = ""], [column = true] {
            /* Flex */
            flex-direction: column;
            /* Alignment */
            align-items: stretch;
        }

        [row = ""], [row = true] {
            /* Flex */
            flex-direction: row;
            /* Alignment */
            align-items: center;
        }
    </style>
